import React, { useState } from "react";
import "./All.css"
import icon from "../Resimler/Süperlig_logo.png"
import { Link } from "react-router-dom";
import axios from "axios";

const Kayıtol = () => {

    const data = {id: "",name: "", email: "" };
    const [kayit, setKayitol] = useState(data)

    const handleData = (e) => {
        setKayitol({ ...Kayıtol, [e.target.name]: e.target.value })
    }

    const handleSubmit = (e) => {
        e.preventDefault();
        axios.post("https://cryptic-gorge-72989.herokuapp.com/users", kayit)
            .then(response => {
                console.log(response)
            })
    }

    return (
        <div>

            <div className="Profil-cercevesi">
                <div className="Profil-cerceve-ici">
                    <Link to={"/Profil"}><p>Geri</p></Link>
                    <div className="orta">
                        <img src={icon} width="70" />
                    </div><br />
                    <div class="form-floating mb-3">
                        <input name="id" value={kayit.id} onChange={handleData} type="number" class="form-control" placeholder="name@example.com" />
                        <label for="floatingInput"><i class="fa-solid fa-user"></i> Kullanıcı Sayı</label>
                    </div>
                    <div class="form-floating mb-3">
                        <input name="name" value={kayit.name} onChange={handleData} type="text" class="form-control" placeholder="name@example.com" />
                        <label for="floatingInput">Kullanıcıadı</label>
                    </div>
                    <div class="form-floating mb-3">
                        <input name="email" value={kayit.email} onChange={handleData} type="email" class="form-control" placeholder="name@example.com" />
                        <label for="floatingInput">E-mail</label>
                    </div>
                    <Link to={"/"}><p><button onClick={handleSubmit} className="button-genisligi btn btn-light">Kayıt Ol</button></p></Link>
                </div>

            </div>
        </div>
    )
}

export default Kayıtol;
